      out.write("    <script>\r\n");
      out.write("      function checkAll() {\r\n");
      out.write("        // 회원가입 양식의 필수컨트롤을 제어하는 함수 (유효성 검사)\r\n");
      out.write("        const form = document.frmJoin;\r\n");
      out.write("\r\n");
      out.write("        if (!checkUserId(form.id.value, form.id)) {\r\n");
      out.write("          return false;\r\n");
      out.write("        } else if (\r\n");
      out.write("          !checkUserPwd(\r\n");
      out.write("            form.pwd.value,\r\n");
      out.write("            form.pwd,\r\n");
      out.write("            form.chkpwd.value,\r\n");
      out.write("            form.id.value\r\n");
      out.write("          )\r\n");
      out.write("        ) {\r\n");
      out.write("          return false;\r\n");
      out.write("        } else if (!checkUserName(form.name.value, form.name)) {\r\n");
      out.write("          return false;\r\n");
      out.write("        } else if (!checkUserGender(form.radio)) {\r\n");
      out.write("          return false;\r\n");
      out.write("        } else if (\r\n");
      out.write("          !checkUserPhone(\r\n");
      out.write("            form.secnumber.value,\r\n");
      out.write("            form.trdnumber.value,\r\n");
      out.write("            form.secnumber,\r\n");
      out.write("            form.trdnumber\r\n");
      out.write("          )\r\n");
      out.write("        ) {\r\n");
      out.write("          return false;\r\n");
      out.write("        } else if (!checkUserEmail(form.email.value)) {\r\n");
      out.write("          return false;\r\n");
      out.write("        }\r\n");
      out.write("        return true;\r\n");
      out.write("      }\r\n");
      out.write("\r\n");
      out.write("      function checkGap(value, ctrlMsg, ctrlName) {\r\n");
      out.write("        // 빈문자를 검사하는 함수\r\n");
      out.write("        if (value == \"\") {\r\n");
      out.write("          alert(ctrlMsg + \"입력해주세요.\");\r\n");
      out.write("          // 커서를 해당 컨트롤에 위치시키려고함\r\n");
      out.write("          ctrlName.focus();\r\n");
      out.write("          return false;\r\n");
      out.write("        }\r\n");
      out.write("        return true;\r\n");
      out.write("      }\r\n");
      out.write("      // 각 컨트롤을 검사하는 함수들\r\n");
      out.write("      function checkUserId(uid, ctrl) {\r\n");
      out.write("        // 입력 받는 아이디값을 검사하는 함수\r\n");
      out.write("        if (!checkGap(uid, \"아이디를\", ctrl)) {\r\n");
      out.write("          return false;\r\n");
      out.write("        }\r\n");
      out.write("        const idRegExp = /^[a-zA-z0-9]{4,16}$/;\r\n");
      out.write("        if (!idRegExp.test(uid)) {\r\n");
      out.write("          alert(\"아이디는 영문 대소문자와 숫자 4~16자리로 입력해야합니다!\");\r\n");
      out.write("          frmJoin.id.value = \"\";\r\n");
      out.write("          frmJoin.id.focus();\r\n");
      out.write("          return false;\r\n");
      out.write("        }\r\n");
      out.write("        return true;\r\n");
      out.write("      }\r\n");
      out.write("      function checkUserPwd(pwd, ctrl, chkpwd, uid) {\r\n");
      out.write("        if (!checkGap(pwd, \"비밀번호를\", ctrl)) {\r\n");
      out.write("          return false;\r\n");
      out.write("        }\r\n");
      out.write("        if (!checkGap(chkpwd, \"비밀번호 확인을\", ctrl)) {\r\n");
      out.write("          return false;\r\n");
      out.write("        }\r\n");
      out.write("        const password1RegExp = /^[a-zA-z0-9]{4,16}$/; //비밀번호 유효성 검사\r\n");
      out.write("        if (!password1RegExp.test(pwd)) {\r\n");
      out.write("          alert(\"비밀번호는 영문 대소문자와 숫자 4~12자리로 입력해야합니다!\");\r\n");
      out.write("          frmJoin.pwd.value = \"\";\r\n");
      out.write("          frmJoin.pwd.focus();\r\n");
      out.write("          return false;\r\n");
      out.write("        }\r\n");
      out.write("        if (pwd != chkpwd) {\r\n");
      out.write("          alert(\"두 비밀번호가 일치하지 않습니다.\");\r\n");
      out.write("          frmJoin.chkpwd.value = \"\";\r\n");
      out.write("          frmJoin.chkpwd.focus();\r\n");
      out.write("          return false;\r\n");
      out.write("        }\r\n");
      out.write("        if (pwd == uid) {\r\n");
      out.write("          alert(\"아이디와 비밀번호는 같을 수 없습니다.\");\r\n");
      out.write("          frmJoin.pwd.value = \"\";\r\n");
      out.write("          frmJoin.chkpwd.value = \"\";\r\n");
      out.write("          frmJoin.pwd.focus();\r\n");
      out.write("          return false;\r\n");
      out.write("        }\r\n");
      out.write("        return true;\r\n");
      out.write("      }\r\n");
      out.write("      function checkUserName(name, ctrl) {\r\n");
      out.write("        if (!checkGap(name, \"이름을\", ctrl)) {\r\n");
      out.write("          return false;\r\n");
      out.write("        }\r\n");
      out.write("        const nameRegExp = /^[가-힣]{2,4}$/;\r\n");
      out.write("        if (!nameRegExp.test(name)) {\r\n");
      out.write("          alert(\"이름이 올바르지 않습니다.\");\r\n");
